contracts/SplittingMarketPlace.sol.content:
// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

import "./SplittingNFT.sol";
import "./SplittingToken.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "./SplittingMarketPlace.sol";

contract SplittingMarketPlace {
    address public owner;
    uint256 public totalNFTs;
    uint256 public totalItems;
    SplittingNFT public splittingNFT;
    SplittingToken public splittingToken;

    // NFT ERC721
    struct ListedNFTToken {
        uint256 tokenId;
        address payable owner;
        address payable seller;
        uint256 price;
        bool currentlyListed;
    }
    event TokenListedSuccess(
        uint256 indexed tokenId,
        address owner,
        address seller,
        uint256 price,
        bool currentlyListed
    );
    mapping(uint256 => ListedNFTToken) public idToListedToken;

    constructor(address _splittingTokenAddress, address _splittingNFTAddress) {
        owner = msg.sender;
        splittingNFT = SplittingNFT(_splittingNFTAddress);
        splittingToken = SplittingToken(_splittingTokenAddress);
    }

    function get_owner() public view returns (address) {
        return owner;
    }

    function get_splittingNFT() public view returns (address) {
        return address(splittingNFT);
    }

    function get_splittingToken() public view returns (address) {
        return address(splittingToken);
    }

    function getListedTokenForId(
        uint256 _tokenId
    ) public view returns (ListedNFTToken memory) {
        return idToListedToken[_tokenId];
    }

    function approveNft(uint256 _tokenId) public {
        splittingNFT.approve(owner, _tokenId);
    }

    function ListedNFT(
        uint256 _tokenId,
        uint256 _price
    ) public returns (ListedNFTToken memory) {
        // require(msg.sender == owner, "You are not the owner of this contract");
        // uint256 tokenId = splittingNFT.createNFT(_NFT_url);
        totalNFTs++;
        // splittingNFT.approveNFT(_tokenId);
        idToListedToken[_tokenId] = ListedNFTToken(
            _tokenId,
            payable(msg.sender),
            payable(msg.sender),
            _price,
            true
        );
        emit TokenListedSuccess(_tokenId, msg.sender, msg.sender, _price, true);
        return idToListedToken[_tokenId];
    }

    function buyNft(uint256 _tokenId) public payable {
        ListedNFTToken memory listedToken = idToListedToken[_tokenId];
        address seller = listedToken.seller;
        uint256 price = listedToken.price;
        require(
            splittingToken.transferFrom(msg.sender, seller, price),
            "Token transfer failed"
        );
        splittingNFT.transferFrom(seller, msg.sender, _tokenId);
        listedToken.owner = payable(msg.sender);
        listedToken.seller = payable(msg.sender);
        listedToken.currentlyListed = false;
        idToListedToken[_tokenId] = listedToken;
    }

    function removeFromMarket(uint256 _tokenId) public {
        ListedNFTToken storage listedToken = idToListedToken[_tokenId];

        require(
            listedToken.seller == msg.sender,
            "You are not the seller of this token"
        );

        delete idToListedToken[_tokenId];

        listedToken.currentlyListed = false;
        idToListedToken[_tokenId] = listedToken;
    }

    function getAllListedTokens()
        public
        view
        returns (ListedNFTToken[] memory)
    {
        ListedNFTToken[] memory listedNFTTokens = new ListedNFTToken[](
            totalNFTs
        );
        uint256 counter = 0;
        for (uint256 i = 1; i <= totalNFTs; i++) {
            if (idToListedToken[i].currentlyListed) {
                listedNFTTokens[counter] = idToListedToken[i];
                counter++;
            }
        }
        return listedNFTTokens;
    }

    function getMyNFTs() public view returns (ListedNFTToken[] memory) {
        ListedNFTToken[] memory listedTokens = new ListedNFTToken[](totalNFTs);
        uint256 counter = 0;
        for (uint256 i = 1; i <= totalNFTs; i++) {
            if (idToListedToken[i].owner == msg.sender) {
                listedTokens[counter] = idToListedToken[i];
                counter++;
            }
        }
        return listedTokens;
    }

    function getAllNFTs() public view returns (ListedNFTToken[] memory) {
        ListedNFTToken[] memory listedTokens = new ListedNFTToken[](totalNFTs);
        uint256 counter = 0;
        for (uint256 i = 1; i <= totalNFTs; i++) {
            listedTokens[counter] = idToListedToken[i];
            counter++;
        }
        return listedTokens;
    }

    function transctionNft(address _to, uint256 _tokenId) public {
        ListedNFTToken memory listedToken = idToListedToken[_tokenId];
        require(
            listedToken.owner == msg.sender,
            "You are not the owner of this NFT"
        );
        splittingNFT.transferFrom(msg.sender, _to, _tokenId);
        listedToken.owner = payable(_to);
        listedToken.seller = payable(_to);
        idToListedToken[_tokenId] = listedToken;
    }

    function editPriceNft(uint256 _tokenId, uint256 _price) public {
        ListedNFTToken memory listedToken = idToListedToken[_tokenId];
        require(
            listedToken.owner == msg.sender,
            "You are not the owner of this NFT"
        );
        listedToken.price = _price;
        idToListedToken[_tokenId] = listedToken;
    }
}

contracts/SplittingNFT.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract SplittingNFT is ERC721URIStorage {
    using Counters for Counters.Counter;
    Counters.Counter private _tokenIds;
    Counters.Counter private _itemsSold;
    address public owner;
    string public NFT_url;
    uint256 public limitMint;
    // price for each rank
    uint256[4] public price = [0.1 ether, 0.5 ether, 1 ether, 2 ether];
    enum Rank {
        Common,
        Rare,
        Epic,
        Legendary
    }

    struct NFT {
        uint256 tokenId;
        string tokenURI;
        Rank rank;
    }

    event NFTCreated(uint256 indexed tokenId, string tokenURI, Rank rank);

    struct MintedNFTInfo {
        uint256 tokenId;
        uint256 rank;
        uint256 mintingPrice;
        address owner_minted;
        uint256 time_minted;
    }
    event NFTMinted(
        uint256 indexed tokenId,
        string tokenURI,
        uint256 rank,
        uint256 mintingPrice,
        address owner_minted,
        uint256 time_minted
    );

    mapping(uint256 => NFT) public NFTs;
    mapping(address => MintedNFTInfo) public MintedNFTInfs;

    constructor() ERC721("Hero NFT", "HR") {
        owner = msg.sender;
        limitMint = 2;
    }

    function withdraw() public payable {
        require(msg.sender == owner, "Only owner can withdraw");
        uint256 balance = address(this).balance;
        payable(msg.sender).transfer(balance);
    }

    function editLimitMint(uint256 _newLimit) public {
        require(msg.sender == owner, "Only owner can edit limit");
        limitMint = _newLimit;
    }

    function mintNFTWithId(
        uint256 _tokenId,
        string memory _NFT_url
    ) public payable {
        // check nft is minted

        // check time_minted + 1 days < now
        require(
            MintedNFTInfs[msg.sender].time_minted + 1 days > block.timestamp,
            "You can only mint this NFT once per day"
        );

        // check MintedNFTInfo[tokenId].owner_minted
        require(
            MintedNFTInfs[msg.sender].owner_minted == msg.sender,
            "You are not the owner of this NFT"
        );

        // Check that the user has already obtained the minting info
        MintedNFTInfo memory mintedInfo = MintedNFTInfs[msg.sender];

        require(
            mintedInfo.mintingPrice > 0,
            "You must call calculateRandomNFTInfo first"
        );

        require(!_exists(_tokenId), "Token ID already exists");
        require(
            balanceOf(msg.sender) < limitMint,
            "You have reached the limit of minting"
        );

        uint256 mintingPrice = mintedInfo.mintingPrice;
        require(msg.value >= mintingPrice, "Insufficient ether sent");

        _tokenIds.increment();
        _mint(msg.sender, _tokenId);
        _setTokenURI(_tokenId, _NFT_url);

        NFTs[_tokenId] = NFT(_tokenId, _NFT_url, Rank(mintedInfo.rank));
        emit NFTCreated(_tokenId, _NFT_url, Rank(mintedInfo.rank));
        delete MintedNFTInfs[msg.sender];
    }

    function calculateRandomNFTInfo() public returns (MintedNFTInfo memory) {
        require(balanceOf(msg.sender) < 2, "You can only own 2 NFTs at most");
        require(
            MintedNFTInfs[msg.sender].tokenId == 0,
            "This NFT has already been minted"
        );

        // Generate a random number between 0 and 99 (inclusive)
        uint256 randomNumber = uint256(
            keccak256(
                abi.encodePacked(block.timestamp, block.difficulty, msg.sender)
            )
        ) % 100;

        // Define the ranges for each rarity
        uint256 commonThreshold = 50; // 0 - 49 (50%)
        uint256 rareThreshold = commonThreshold + 30; // 50 - 79 (30%)
        uint256 epicThreshold = rareThreshold + 15; // 80 - 94 (15%)
        uint256 legendaryThreshold = epicThreshold + 5; // 95 - 99 (5%)

        Rank randomRank;

        // Determine the rarity based on the random number generated
        if (randomNumber < commonThreshold) {
            randomRank = Rank.Common;
        } else if (randomNumber < rareThreshold) {
            randomRank = Rank.Rare;
        } else if (randomNumber < epicThreshold) {
            randomRank = Rank.Epic;
        } else {
            randomRank = Rank.Legendary;
        }

        // Get the minting price for the chosen rarity
        uint256 mintingPrice = getPrice(uint256(randomRank));

        MintedNFTInfo memory mintedInfo = MintedNFTInfo(
            randomNumber,
            uint256(randomRank),
            mintingPrice,
            msg.sender,
            block.timestamp
        );

        // save mintedInfo to MintedNFTInfs
        MintedNFTInfs[msg.sender] = mintedInfo;

        emit NFTMinted(
            randomNumber,
            NFT_url,
            uint256(randomRank),
            mintingPrice,
            msg.sender,
            block.timestamp
        );

        return mintedInfo;
    }

    // get info of minted NFT
    function getMintedNFTInfo(
        address _owners
    ) public view returns (MintedNFTInfo memory) {
        return MintedNFTInfs[_owners];
    }

    function editPriceMint(uint256 _rank, uint256 _newPrice) public {
        require(msg.sender == owner, "Only owner can edit price");
        price[_rank] = _newPrice;
    }

    function getPrice(uint256 _rank) public view returns (uint256) {
        return price[_rank];
    }

    function getAllMyNft() public view returns (uint256[] memory) {
        uint256[] memory result = new uint256[](_tokenIds.current());
        uint256 counter = 0;
        for (uint256 i = 1; i <= _tokenIds.current(); i++) {
            if (ownerOf(i) == msg.sender) {
                result[counter] = i;
                counter++;
            }
        }
        return result;
    }

    function getNFTURI(uint256 tokenId) public view returns (string memory) {
        return tokenURI(tokenId);
    }

    function getNFTRank(uint256 tokenId) public view returns (Rank) {
        require(_exists(tokenId), "Token ID does not exist");

        return NFTs[tokenId].rank;
    }

    function transferNFT(address _to, uint256 _tokenId) public {
        safeTransferFrom(msg.sender, _to, _tokenId);
    }

    function _burn(uint256 tokenId) internal override(ERC721URIStorage) {
        super._burn(tokenId);
    }

    function tokenURI(
        uint256 tokenId
    ) public view override(ERC721URIStorage) returns (string memory) {
        return super.tokenURI(tokenId);
    }

    function supportsInterface(
        bytes4 interfaceId
    ) public view override(ERC721URIStorage) returns (bool) {
        return super.supportsInterface(interfaceId);
    }

    function getAllMintedNFTs() public view returns (NFT[] memory) {
        NFT[] memory mintedNFTs = new NFT[](_tokenIds.current());

        for (uint256 i = 1; i <= _tokenIds.current(); i++) {
            if (_exists(i)) {
                mintedNFTs[i - 1] = NFTs[i];
            }
        }

        return mintedNFTs;
    }
}

contracts/SplittingToken.sol.content:
// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

contract SplittingToken is ERC20("Hero Token", "HRT"), Ownable {
    uint256 private cap = 100_000_000_000 * 10 ** 18;

    constructor() public {
        _mint(msg.sender, cap);
        transferOwnership(msg.sender);
    }

    function mint(address _to, uint256 _amount) public onlyOwner {
        require(
            ERC20.totalSupply() + _amount <= cap,
            "SplittingToken: cap exceeded"
        );
        _mint(_to, _amount);
    }

    function transfer(
        address _to,
        uint256 _amount
    ) public override returns (bool) {
        return super.transfer(_to, _amount);
    }
}

